full_text:
Adults across North Wales can now book an appointment for a COVID booster online.

@BetsiCadwaladr Health Board are also urging people with appointments in December to keep them.

#CapitalReports

There's a lot of information regarding the new Covid - 19 variant, Omicron, lately. If you're feeling anxious please know you are not alone.

@MindCharity have brilliant tips and advice to help you with the difficult feelings you may be experiencing. 
Read:https://t.co/bR7kVyQm6x
